import { Component, OnInit } from '@angular/core';

interface Task {
  id: string;
  startTime: string;
  endTime: string;
}

interface Day {
  date: Date;
  isToday: boolean;
  tasks: Task[];
}

@Component({
  selector: 'app-calender',
  templateUrl: './calender.component.html',
  styleUrls: ['./calender.component.css'],
})
